import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Admin from 'pages/Admin';
import NotFound from 'pages/NotFound';
import ScrollToHash from './components/ScrollToHash';
import withStyles from 'components/withStyles'; // <-- Import withStyles
const Newsfeed = React.lazy(() => import('pages/Newsfeed'));
const Waitlist = React.lazy(() => import('pages/Waitlist'));
const Landingpage = React.lazy(() => import('pages/Landingpage'));

const ProjectRoutes = () => {
  return (
    <React.Suspense fallback={<>Loading...</>}>
      <Router>
        <ScrollToHash />
        <Routes>
          {/* <Route path="/" element={<Home />} /> */}
          <Route path="*" element={<NotFound />} />
          <Route
            path="/"
            element={
              React.createElement(
                withStyles(
                  Landingpage,
                  require('pages/Landingpage/Landingpage.css'),
                ),
              )
            }
          />
          <Route
            path="/waitlist"
            element={
              React.createElement(
                withStyles(
                  Waitlist,
                  require('pages/Waitlist/Waitlist.css'),
                ),
              )
            }
          />
          <Route
            path="/newsfeed"
            element={
              React.createElement(
                withStyles(
                  Newsfeed,
                  require('pages/Newsfeed/Newsfeed.css'),
                ),
              )
            }
          />
          <Route path="/admin" element={<Admin />} />
        </Routes>
      </Router>
    </React.Suspense>
  );
};

export default ProjectRoutes;
